import React, { useState } from 'react';
import './signup.css';
import { Link, NavLink  } from "react-router-dom";
import { useForm } from '@mui/material';
const Signup = () => { 
  const [showPassword, setShowPassword] = useState(false);

  function validatePassword() {
    const password = document.getElementById('password');
    const confirm_password = document.getElementById('confirm_password');

    if (password.value !== confirm_password.value) {
      confirm_password.setCustomValidity("Passwords Don't Match");
    } else {
      confirm_password.setCustomValidity('');
    }
  }

  const toggleShowPassword = () => {
    setShowPassword(!showPassword);
  };

  return (
    <>
    <meta charSet="UTF-8" />
    <title>Sign up Page</title>
    
    <div className="container1-6">
      <h5>Sign Up</h5>
      <form>
        <input type="text" placeholder="Enter your full name" required />
        <br />
        <input
          type={showPassword ? 'text' : 'password'}
          placeholder="Enter your password"
          name="psw"
          id="password"
          required
        />
        <span>
          <i
            id="toggler"
            className={`far ${showPassword ? 'fa-eye-slash' : 'fa-eye'}`}
            onClick={toggleShowPassword}
          />
        </span>
        <br />
        <input
          type={showPassword ? 'text' : 'password'}
          placeholder="Repeat Password"
          name="psw-repeat"
          id="confirm_password"
          required
          onChange={validatePassword}
        />
        <input type="email" placeholder="Email Address" required />
        <input
          type="tel"
          onKeyPress={(event) => {
            if (!/[0-9]/.test(event.key)) {
              event.preventDefault();
            }
          }}
          placeholder="Mobile Number"
          required
        />
        <input type="text" placeholder="Enter your address" required />
        <br /> <br />
        <div>
          <label htmlFor="Gender" className="Glabel">
            Gender:
          </label>
          <select
            name="Gender"
            id="Gender"
            className="selection"
            required
          >
            <option value="">--</option>
            <option value="male">Male</option>
          <option value="female">Female</option>
        </select>
        <br />
        <br />
      </div>
      <div>
        <label htmlFor="Blood Group" className="label">
          Blood Group:
        </label>
        <select
          name="Blood Group"
          id="Blood Group"
          className="selection"
          required=""
        >
          <option value="">please select</option>
          <option value="A+">A+</option>
          <option value="A-">A-</option>
          <option value="B+">B+</option>
          <option value="B-">B-</option>
          <option value="O+">O+</option>
          <option value="O-">O-</option>
          <option value="AB+">AB+</option>
          <option value="AB-">AB-</option>
        </select>
        <br />
      </div>
      <div>
        <input type="checkbox" className="check_box" required="" />
        <p>
          Before sign up check the{" "}
          <a href="donate/index.html">eligibility to donate</a>
        </p>
      </div>
      <input type="submit" defaultValue="Register" className="button6" />
    </form>
  </div>
</>



  
  );
};

export default Signup;
